<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>Google Search</title>
  </head>
  <body>
    <input id="searchInput" type="text" placeholder="Enter your search query" />
    <button id="searchButton" onclick="gcse-search">Search</button>
    <script
      async
      src="
    https://cse.google.com/cse?cx=51f79a1a57f004618"
    >
      fetch('https://customsearch.googleapis.com/customsearch/v1?q=cars&searchType=searchTypeUndefined&key=AIzaSyCzjC48pJ5riPvGwNauwY2zs6xNgf31FlU&cx=51f79a1a57f004618',{
         })
      .then(
           response => response.json()
      )
      .then(data => {
          data.items.forEach(element => {
              console.log(element.title);
          });
        })
      .catch(error => console.error(error))
    </script>
    <div class="gcse-search"></div>
  </body>
</html>
